<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\SecurityDomain\Domain\SecurityDomainRef;
use Civi\Lughauth\Features\Access\SecurityAttribute\Domain\SecurityAttributeRef;
use Civi\Lughauth\Features\Access\ScopeAttributePermission\Domain\ValueObject\ScopeAttributePermissionSecurityDomainVO;
use Civi\Lughauth\Features\Access\ScopeAttributePermission\Domain\ValueObject\ScopeAttributePermissionSecurityAttributeVO;
use Civi\Lughauth\Features\Access\ScopeAttributePermission\Domain\ValueObject\ScopeAttributePermissionPermisionVO;
use Civi\Lughauth\Features\Access\ScopeAttributePermission\Domain\ValueObject\ScopeAttributePermissionVersionVO;
use Civi\Lughauth\Features\Access\ScopeAttributePermission\Domain\ScopeAttributePermissionAttributes;
use PHPUnit\Framework\TestCase;

final class ScopeAttributePermissionAttributesUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new ScopeAttributePermissionAttributes();
        $securityDomainOneValue = $this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['one'])->getMock();
        $securityDomainOtherValue = $this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->securityDomain($securityDomainOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityDomain());
        $this->assertNotEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityDomain());
        $this->assertEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityDomainOrDefault(ScopeAttributePermissionSecurityDomainVO::from($securityDomainOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityDomainOrDefault(ScopeAttributePermissionSecurityDomainVO::from($securityDomainOtherValue))->value());
        $value->unsetSecurityDomain();
        $this->assertEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityDomainOrDefault(ScopeAttributePermissionSecurityDomainVO::from($securityDomainOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(SecurityDomainRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityDomainOrDefault(ScopeAttributePermissionSecurityDomainVO::from($securityDomainOtherValue))->value());
        $securityAttributeOneValue = $this->getMockBuilder(SecurityAttributeRef::class)->setConstructorArgs(['one'])->getMock();
        $securityAttributeOtherValue = $this->getMockBuilder(SecurityAttributeRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->securityAttribute($securityAttributeOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(SecurityAttributeRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityAttribute());
        $this->assertNotEquals($this->getMockBuilder(SecurityAttributeRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityAttribute());
        $this->assertEquals($this->getMockBuilder(SecurityAttributeRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityAttributeOrDefault(ScopeAttributePermissionSecurityAttributeVO::from($securityAttributeOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(SecurityAttributeRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityAttributeOrDefault(ScopeAttributePermissionSecurityAttributeVO::from($securityAttributeOtherValue))->value());
        $value->unsetSecurityAttribute();
        $this->assertEquals($this->getMockBuilder(SecurityAttributeRef::class)->setConstructorArgs(['other'])->getMock(), $value->getSecurityAttributeOrDefault(ScopeAttributePermissionSecurityAttributeVO::from($securityAttributeOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(SecurityAttributeRef::class)->setConstructorArgs(['one'])->getMock(), $value->getSecurityAttributeOrDefault(ScopeAttributePermissionSecurityAttributeVO::from($securityAttributeOtherValue))->value());
        $permisionOneValue = 'VIEW';
        $permisionOtherValue = 'MODIFY';
        $copy = $value->permision($permisionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('VIEW', $value->getPermision());
        $this->assertNotEquals('MODIFY', $value->getPermision());
        $this->assertEquals('VIEW', $value->getPermisionOrDefault(ScopeAttributePermissionPermisionVO::from($permisionOtherValue))->value());
        $this->assertNotEquals('MODIFY', $value->getPermisionOrDefault(ScopeAttributePermissionPermisionVO::from($permisionOtherValue))->value());
        $value->unsetPermision();
        $this->assertEquals('MODIFY', $value->getPermisionOrDefault(ScopeAttributePermissionPermisionVO::from($permisionOtherValue))->value());
        $this->assertNotEquals('VIEW', $value->getPermisionOrDefault(ScopeAttributePermissionPermisionVO::from($permisionOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(ScopeAttributePermissionVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(ScopeAttributePermissionVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(ScopeAttributePermissionVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(ScopeAttributePermissionVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
